import React from "react";

const SiginWelcomePage = ({ userData }) => {
  return (
    <div>
      <h1>Hello {userData.username}!</h1>
      <h2>Your password is "{userData.password}"</h2>
    </div>
  );
};
export default SiginWelcomePage;
